	@Inject
	public KRenderingGrammarAccess(GrammarProvider grammarProvider,
		KLayoutDataGrammarAccess gaKLayoutData) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaKLayoutData = gaKLayoutData;
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("de.cau.cs.kieler.core.kgraph.text.krendering.KRendering".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	
	public Grammar getGrammar() {
		return grammar;
	}
	

	public KLayoutDataGrammarAccess getKLayoutDataGrammarAccess() {
		return gaKLayoutData;
	}

	
